import React, { useState } from 'react';
import './Navbar.css';



const Navbar = () => {
    const [active, setActive] = useState(false)

    const [isNavExpanded, setIsNavExpanded] = useState(null)
    return (
        <nav className='navigate'>
            <a href='/' className='name'>Name</a>
            <button className="menu-btn" onClick={() => {
                setIsNavExpanded(!isNavExpanded)
            }}>
                {
                    isNavExpanded ? <i class="fa-solid fa-xmark"></i> : <i class="fa-solid fa-bars"></i>
                }
            </button>
            <div className={
                isNavExpanded ? "menu expanded" : "menu"
            }>
                <ul>
                    <li ><a href='/' className={active ? active : 'menu li a'} onclick={() => setActive('select')}>Home</a></li>
                    <li ><a href='/Events' className='act'>Events</a></li>
                    <li ><a href='/Registration' >Registration</a></li>
                    <li ><a href='/login' className='act'>Login</a></li>
                </ul>
            </div>
        </nav >
    )
}

export default Navbar
